Wikipedia: modulo operation Wikipedia: diffie hellman Computerphile: diffie hellman with colors Computerphile: diffie hellman with modulo operations The Rust Playground Rust code that follows along with the diffie hellman wikipedia article . Feel free to edit and play around with it here, or copypasta into the Rust Playground // TODO: add an explanation for primitive Root Modulo Stuff
// - the base is a primitive root modulo
// - this is not explained, thus this is not an end-to-end tutorial
// - how do we explain this simply? fn main() { // Alice and Bob's Agreed Upon Parameters let base = 5; let modulus = 23; // Alice and Bob's Private Keys let a_private = 4; let b_private = 3; // Function to perform exponential modulo artithmetic // because rust makes exponential multiplication with // i32 a real bother // (b**p) % m fn exp_mod(b: i32, p: i32, m: i32) -> i32 { let mut out = (b * b) % m; //println!("0: {}", out); for i in 1..p-1 { //because the first iter of out took 2 off the base out = (out * b) % m; //println!("{}: {}", i, out); } out } // Alice and Bob's Public Keys let a_public = exp_mod(base, a_private, modulus); let b_public = exp_mod(base, b_private, modulus); // Let's Check To See If It Worked! let to_a_from_b = exp_mod(b_public, a_private, modulus); let to_b_from_a = exp_mod(a_public, b_private, modulus); assert_eq!(to_a_from_b, to_b_from_a); //println!("to_a_from_b: {}", to_a_from_b); //println!("to_b_from_a: {}", to_b_from_a); }
